import React, {Component} from 'react';
import logo from './nba-logoman-word-white.svg';
export class TopNavBar extends Component {
    render() {
        return (
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
            </header>
        );
    }
}
